import React from "react";
const WelcomeWindow = ({ user }) => {
  const { name, pic, status } = user;
  return (
    <div className="welcome-window">
      <img src={user.pic} />
      <h1>Hello {user.name}</h1>
      <h3>Status: {user.status}</h3>
    </div>
  );
};

export default WelcomeWindow;
